import React from 'react';
import { useNavigate } from 'react-router-dom';

function UseScenarios() {
    const navigate = useNavigate();

    return (
        <div>
            USE SCENARIOS
            <div>
                <button onClick={() => navigate('/scenarios/make')}>Go to Make Scenarios</button>
            </div>
            <div>
                {/* Form elements for options */}
                <input
                    type="number"
                    value={numberOfDeals}
                    onChange={e => setNumberOfDeals(e.target.value)}
                    placeholder="Number Of Deals"
                />
                <select value={vul} onChange={e => setVul(e.target.value)}>
                    {/* Add options for Vul here */}
                </select>
                <select value={scoring} onChange={e => setScoring(e.target.value)}>
                    {/* Add options for Scoring here */}
                </select>
                <select value={flip} onChange={e => setFlip(e.target.value)}>
                    {/* Add options for Flip here */}
                </select>
                <select value={dealer} onChange={e => setDealer(e.target.value)}>
                    {/* Add options for Dealer here */}
                </select>
                <button onClick={generateDealSet}>Generate Deal Set</button>
                <button onClick={() => navigate('/scenarios/make')}>Go to Make Scenarios</button>
            </div>
        </div>
    );
}

export default UseScenarios;
